import React, {useEffect, useState} from 'react';
import axios from "axios";


const Meal = () => {
    const [food, setFood] = useState({});
    useEffect(()=>{
        axios(`https://www.themealdb.com/api/json/v1/1/lookup.php?i=${params.id}`)
            .then(({data})=> setFood(data.meals[0]))
    },[]);
    return (
        <div>
            <h1>Meal</h1>
        </div>
    );
};

export default Meal;
